/**
 * Returns a slice of fallback images
 * 
 * @param count Number of images to return (default: 50)
 * @param startIndex Starting index (default: 0)
 * @returns Array of image URLs
 */
export function getFallbackImages(count: number = 50, startIndex: number = 0): string[] {
  // Ensure we don't exceed the bounds of the array
  const safeCount = Math.min(count, fallbackImages.length - startIndex);
  
  if (safeCount <= 0) {
    console.warn(`getFallbackImages: Invalid parameters. Count: ${count}, startIndex: ${startIndex}, available: ${fallbackImages.length}`);
    return fallbackImages.slice(0, 50); // Return first 50 as fallback
  }
  
  if (count > safeCount && typeof window !== 'undefined' && process.env.NODE_ENV === 'development') {
    console.warn(`getFallbackImages: Requested ${count} images, but only ${safeCount} available starting from index ${startIndex}`);
  }
  
  return fallbackImages.slice(startIndex, startIndex + safeCount);
}
